import React from "react"
import io from "socket.io-client"
import { Flex } from "rebass"
import Editor from "./components/editor"

const socket = io("http://localhost:4000")

const App = () => {

  useEffect(() => {
    socket.emit("joinRoom", "room")
  })

  return (
    <Flex>
      <Editor/>
    </Flex>
  )
}

export default App;
